import React from 'react';
import './App.css';
import subject1 from './res/subject1.png';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="pool1">
          <img source={subject1} style={{width:100, height: 250}} resizeMode='stretch' alt=''/>
        </div>
        <div className="pool2">
          <img source={require('./res/test.png')} style={{width:100, height: 250}} resizeMode='stretch' alt='' />
        </div>
        <div className="pool3">
          <img source={require('./res/subject3.png')} style={{width:100, height: 250}} resizeMode='stretch' alt='' />
        </div>
      </header>
    </div>
  );
}

export default App;
